import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

function Index() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-600 to-blue-500 flex flex-col justify-center items-center text-white">
      <motion.div
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="text-center"
      >
        <h1 className="text-6xl font-extrabold mb-4">TokTok</h1>
        <p className="text-2xl mb-8">Exclusive Software for Extraordinary People</p>
      </motion.div>

      <motion.div
        initial={{ opacity: 0, scale: 0.5 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.8, delay: 0.3 }}
        className="bg-white bg-opacity-10 backdrop-filter backdrop-blur-lg rounded-xl p-8 max-w-2xl w-full"
      >
        <h2 className="text-3xl font-bold mb-6">Join Our Elite Circle</h2>
        <p className="text-lg mb-6">
          TokTok creates bespoke software solutions for a select group of visionaries. 
          Our invitation-only platform pushes the boundaries of what's possible in the digital realm.
        </p>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <motion.div whileHover={{ scale: 1.05 }} whileTap={{ scale: 0.95 }}>
            <Link to="/register" className="block w-full bg-purple-500 hover:bg-purple-600 text-white font-bold py-3 px-4 rounded-lg transition duration-300 text-center">
              Request Invitation
            </Link>
          </motion.div>
          <motion.div whileHover={{ scale: 1.05 }} whileTap={{ scale: 0.95 }}>
            <Link to="/login" className="block w-full bg-blue-500 hover:bg-blue-600 text-white font-bold py-3 px-4 rounded-lg transition duration-300 text-center">
              Member Login
            </Link>
          </motion.div>
        </div>
      </motion.div>

      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.6 }}
        className="mt-12 text-center"
      >
        <h3 className="text-2xl font-semibold mb-4">Why TokTok?</h3>
        <div className="flex flex-wrap justify-center gap-6">
          {['Innovative', 'Exclusive', 'Secure', 'Cutting-edge'].map((feature, index) => (
            <motion.div
              key={index}
              whileHover={{ scale: 1.1, rotate: 5 }}
              className="bg-white bg-opacity-20 rounded-full px-6 py-2"
            >
              {feature}
            </motion.div>
          ))}
        </div>
      </motion.div>
    </div>
  );
}

export default Index;
